        saveas(gcf,'reports/daily.png')
    
    %Recovered

        figure()
        plot(t(Number:end-Shift),recovered(Number:end-Shift),'^-',t(Number:end-Shift),pred_recovered(Number + Shift:end) , '-o', t(Number:end-Shift), recovered_smooth(t(Number:end-Shift)), '-x');
        grid on;
